"use strict";

const { Counter } = require('collections');
function f_gold(tasks) {
    const cnt = new Counter(tasks);
    const mi = Math.min(...cnt.values());
    if (mi === 1) {
        return -1;
    }
    return cnt.values().reduce((acc, v) => acc + Math.floor(v / 3) + (v % 3 === 0 ? 0 : 1), 0);
}
